 import React from "react";
import Avatar from "./AvaDecr/Avatar";
import NewPost from "./New post/NewPost";
import MyPosts from "./My posts/MyPosts";


const Profile = (props) => {


    let postElements =
    props.posts.map( posts => <MyPosts post={posts.post} />);

    return (
        <div>
            <Avatar />
            <NewPost />
            {postElements}
        </div>
    );
}

export default Profile;
